import React, { useState } from "react";
import ExpenseItem from "./ExpenseItem";
import ExpensesFilter from "./NewExpense/ExpenseFilter";
import Card from "../UI/Card"
import "./Expenses.css"

const Expenses = (props) => {
    const [filteredYear, setFilteredYear] = useState(2020)
    const filterChangeHandler = (selectedYear) => {
        setFilteredYear(selectedYear)

    }

    return (
        <div>

            <Card className="expenses">

                <ExpensesFilter selected={filteredYear} onFilterChange={filterChangeHandler} />
                {props.items.map((expense) => <ExpenseItem titleex={expense.title} />)}
                <ExpenseItem titleex={props.items[0].title} dateex={props.items[0].date} amountex={props.items[0].amount}></ExpenseItem>
                <ExpenseItem titleex={props.items[1].title} dateex={props.items[1].date} amountex={props.items[1].amount}></ExpenseItem>
                <ExpenseItem titleex={props.items[2].title} dateex={props.items[2].date} amountex={props.items[2].amount}></ExpenseItem>
                <ExpenseItem titleex={props.items[3].title} dateex={props.items[3].date} amountex={props.items[3].amount}></ExpenseItem>
            </Card>
        </div>)

}
export default Expenses;
